import React from "react";
import SpaceBarMini from "../../assets/images/spacebar-mini.png";
import JblueryLink from "../../assets/images/jbluery-nav-logo.png";
import "../Navigation/Navigation.scss";
import { NavLink } from "react-router-dom";

export default function Navigation() {
  return (
    <div>
      <Navigation className="NavBar">
        <NavLink to="/" className="NavBar__left">
          <img src={SpaceBarMini} alt="Metaverse" />
        </NavLink>
        <NavLink to="https://www.jbluery.com/">
          <img
            src={JblueryLink}
            className="NavBar__right"
            alt="Metaverse-home-link"
          />
        </NavLink>
      </Navigation>
    </div>
  );
}
